import { useState } from "react";
import { useHistory } from "react-router-dom";
import "./styles/Signup.css";
import trashCanIcon from "../path/to/trash-can.svg";

function ListItem({ index, onDelete }) {
	// Remaining code for ListItem component...
}

function Signup() {
	const enumValues = ["Option 1", "Option 2", "Option 3"];
	const history = useHistory();

	const [firstName, setFirstName] = useState("");
	const [lastName, setLastName] = useState("");
	const [interests, setInterests] = useState("");
	const [password, setPassword] = useState("");
	const [confirmPassword, setConfirmPassword] = useState("");
	const [listItems, setListItems] = useState([]);
	const [signedIn, setSignedIn] = useState(false);

	const handleFirstNameChange = (event) => {
		setFirstName(event.target.value);
	};

	const handleLastNameChange = (event) => {
		setLastName(event.target.value);
	};

	const handleInterestsChange = (event) => {
		setInterests(event.target.value);
	};

	const handlePasswordChange = (event) => {
		setPassword(event.target.value);
	};

	const handleConfirmPasswordChange = (event) => {
		setConfirmPassword(event.target.value);
	};

	const handleAddButton = () => {
		setListItems((prevListItems) => [
			...prevListItems,
			<ListItem
				key={prevListItems.length}
				index={prevListItems.length}
				onDelete={handleDelete}
			/>,
		]);
	};

	const handleDelete = (index) => {
		setListItems((prevListItems) =>
			prevListItems.filter((item, i) => i !== index)
		);
	};

	const handleSubmit = (event) => {
		event.preventDefault();

		// Perform password validation
		if (password !== confirmPassword) {
			alert("Passwords do not match");
			return;
		}

		// Retrieve form data and perform necessary actions
		const formData = new FormData(event.target);
		for (const pair of formData.entries()) {
			console.log(pair[0] + ": " + pair[1]);
		}

		// Additional logic for submitting the form and handling the data on the server-side can be implemented here.
		// You'll need to write server-side code to handle form submission and store user information securely.

		// Simulate successful signup
		setSignedIn(true);

		// Redirect to signed-in view
		history.push("/signedin");
	};

	if (signedIn) {
		return <div>Signed In View</div>; // Replace with your signed-in view component
	}

	return (
		<div className="signup">
			<div className="form-container">
				// Rest of the code...
				<form className="signup-form" id="my-form" onSubmit={handleSubmit}>
					<div className="name-wrapper">
						<input
							type="text"
							placeholder="First Name"
							name="firstName"
							value={firstName}
							onChange={handleFirstNameChange}
						/>
						<input
							type="text"
							placeholder="Last Name"
							name="lastName"
							value={lastName}
							onChange={handleLastNameChange}
						/>
					</div>
					<label>Interests</label>
					<textarea
						placeholder="Interests"
						name="interests"
						style={{ height: "200px" }}
						value={interests}
						onChange={handleInterestsChange}
					></textarea>

					<label>Password</label>
					<input
						type="password"
						placeholder="Password"
						name="password"
						value={password}
						onChange={handlePasswordChange}
					/>

					<label>Confirm Password</label>
					<input
						type="password"
						placeholder="Confirm Password"
						name="confirmPassword"
						value={confirmPassword}
						onChange={handleConfirmPasswordChange}
					/>

					<label>Content Sources</label>

					<div id="list-container">
						{listItems.map((item, index) => (
							<React.Fragment key={index}>{item}</React.Fragment>
						))}
						<div className="button-wrapper">
							<button id="add-button" type="button" onClick={handleAddButton}>
								+
							</button>
						</div>
					</div>
					<div className="button-wrapper">
						<input type="submit" value="Sign Up" />
					</div>
				</form>
			</div>
		</div>
	);
}

export default Signup;
